import { useState } from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import StartPage from './components/StartPage';
import Header from './components-from-crash-course/Header';
import Footer from './components-from-crash-course/Footer';
import About from './components-from-crash-course/About';
import './App.css';



const App = () => {
  return (
    <Router>
      <div className='container'>
        <Header />
        <Routes>
          <Route
            path='/'
            element={
              <>
                ('No Tasks To Show')
              </>
            }
          />
          <Route path='/about' element={<About />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  )
}





export default App;
